CREATE DEFINER=`root`@`localhost` FUNCTION `change_password`(id INT ,pswd_old VARCHAR(1024) ,pswd_new VARCHAR(1024)) RETURNS varchar(1024) CHARSET utf8 COLLATE utf8_unicode_ci
BEGIN
	DECLARE user_id INT DEFAULT (
		SELECT U.id FROM users AS U 
        WHERE id = U.id
        AND pswd_old = U.`password` COLLATE utf8_unicode_ci
    );
    
    IF user_id IS NULL THEN
		RETURN 'wrong password';
    END IF;
    
    UPDATE `dinnersys`.`users`
	SET `password` = pswd_new
	WHERE `users`.`id` = user_id;
    
    RETURN 'success';
END ;;
