CREATE DEFINER=`root`@`localhost` PROCEDURE `create_moneytrace`(esti_recv DATETIME)
BEGIN
	#### CREATE PAYMENT ####
	CALL create_payment(esti_recv);
	CALL create_payment(esti_recv);
	CALL create_payment(esti_recv);
	CALL create_payment(esti_recv);

	#### MAKE MONEY TRACE ####
	SET @id = 
	(
		SELECT id FROM `dinnersys`.`payment` AS P WHERE id = (SELECT MAX(id) FROM `dinnersys`.`payment`)
	);

	INSERT INTO `dinnersys`.`money_trace`
	(`charge`,
	`user`,
	`dinnerman`,
	`cafeteria`,
	`factory`)
	VALUES ('55', @id - 0, @id - 1, @id - 2, @id - 3);
END ;;
